import { Link } from "react-router-dom";
import shoes from "../utils/shoes.json";

const Grid = () => {
    console.log(shoes)
    return (
        <ul>
            {shoes.map(shoe =>{ 
            <li>{shoe.id}<br/>
            {shoe.name}
            </li>})}
        </ul>

    )
};

export default Grid;
